import { createRouter, createWebHashHistory } from 'vue-router';
import '@fortawesome/fontawesome-free/css/all.css';
import '@fortawesome/fontawesome-free/js/all.js';

const Login = () => import('../pages/Login/LoginComponent');
const Home = () => import('../pages/Home/HomeComponent');
const Pessoa = () => import('../pages/Pessoa/PessoaComponent');
const Produto = () => import('../pages/Produto/ProdutoComponent');
const Venda = () => import('../pages/Venda/VendaComponent');
const Compra = () => import('../pages/Compra/CompraComponent');

const routes = [
    { path: '/', name:'login', component: Login },
    { path: '/home', name:'home', component: Home },
    { path: '/pessoa', name:'pessoa', component: Pessoa },
    { path: '/produto', name:'produto', component: Produto },
    { path: '/venda', name:'venda', component: Venda },
    { path: '/compra', name:'compra', component: Compra },
];

const router = createRouter({
  history: createWebHashHistory(),
  routes,
});

export default router;
